import React, { useState } from 'react';

const App = () => {
    const[num, setNum] = useState();
    var srt = Math.sqrt();
    var crt = Math.cbrt();
    const sqrt = () => {
       Math.sqrt(num);
    }

    const cbrt = () => {
        Math.cbrt(num);
    }

    const value = (event) => {
        setNum(event.target.value);
    }

return(
    <>
    <div>
     <h1>your square root of {num} is {srt}</h1>
     <h1>your Cube root of {num} is {crt}</h1>
    <input type="text" id="text" placeholder="type a number"  onChange={value} style={{marginLeft: '10px', marginTop: '5px'}}/><br/>
    <button onClick={sqrt} style={{marginLeft: '10px', marginTop: '5px'}}>Square Root</button>
    <button onClick={cbrt} style={{marginLeft: '10px', marginTop: '5px'}}>Cube Root</button>
    </div>
    </>
)

}

export default App;
